            if (0 <= x && x < m && 0 <= y && y < n && grid[x][y] == 1) {
                dfs(x, y);
            }
        }
    }
    let m = grid.length, n = grid[0].length;
    for (let i = 0; i < m; i++) {
        for (let j = 0; j < n; j++) {
            if (grid[i][j] == 1 && (i == 0 || i == m - 1 || j == 0 || j == n - 1)) {
                dfs(i, j);
            }
        }
    }
    return grid.reduce((a, b) => a + b.reduce((c, d) => c + d, 0), 0);
